import React from 'react';

const Card = (props) => {
	return (
		<div>
			<img alt='robot' src={`https://robohash.org/${props.id}?400x400`}/>
			<div>
				<h2>{props.name}</h2>
				<p>{props.email}</p>
			</div>
		</div>
		);
}

export default Card;
